import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      monsters: [
        {
          name: 'Logan',
          id: 'jgh34jgb'
        },
        {
          name: 'Katieann',
          id: 'jgh4rjgb'
        },
        {
          name: 'Paige',
          id: 'jgh34sdb'
        }
      ]

    };
  }

  render() {
    return (
      <div className="App">
        { this.state.monsters.map((monster) => {
            return <h1 key={monster.id}>{monster.name}</h1>
          })}
      </div>
    );
  }
}

export default App;
